pragma solidity >=0.5.0 < 0.9.0;

contract Demo {
    // Defining byte array
    bytes2 public b2; // bytes2 -> datatype of 2byte array
    bytes3 public b3;

    function setter() public {
        b2 = "ab";
        b3 = "abc";
    }
}
